import clsx from'clsx'
import style from'./Home.module.css'
import Frame from'../aces/Img/Frame 1.png'


function Home() {
  return (
    <div>
        <div className={clsx(style.MainSlider)}>
            <div><h1>Clinic & beauty consultant</h1>
            <p>It is a long established fact that a reader will be by the readable content of a page.</p>
            <button className={clsx(style.Frame)}>More Details</button></div>
            <div><img className={clsx(style.Frame)} src={Frame} alt="" /></div>


        </div>
    </div>
  );
}

export default Home;
